import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-instrument',
  templateUrl: './instrument.component.html',
  styleUrls: ['./instrument.component.css']
})
export class InstrumentComponent implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<section class="instrument-wrapper">
  <div class="container">
    <div class="row">
      <div class="col-12">
        <div class="instrument d-flex flex-column align-items-center justify-content-center">
          <span>Instrument</span>
          <select class="form-select" aria-label="Default select example">
            <option selected>Piano</option>
            <option value="1">Piano1</option>
            <option value="2">Piano2</option>
            <option value="3">Piano3</option>
          </select>
        </div>
      </div>
    </div>
  </div>
</section>
